

var install_location_list;
$(document).ready(function(e)
{
	install_location_list= function()
	{
		if($(".phRegion_sel").length > 0)
		{
			$(".phRegion_sel option[id!='0']").remove();
			$.each(ph_region_list,function(i,v)
			{
				$(".phRegion_sel").append('<option id="'+v.id+'" data-code="'+v.code+'" value="'+v.id+'">'+v.name+'</option>');
			});

			$(".phRegion_sel").unbind("change").change(function(e)
			{
				$(".phProvince_sel option[id!='0'], .phCity_sel option[id!='0'], .phBrgy_sel option[id!='0']").remove();
				setProvince_sel($(this).children(":selected").attr("data-code"));
			});
		}

		var setProvince_sel= function(c)
		{
			if($(".phProvince_sel").length > 0)
			{
				$(".phProvince_sel option[id!='0']").remove();
				$.each(ph_province_list,function(i,v)
				{
					if(v.reg_code==c)
					{
						$(".phProvince_sel").append('<option id="'+v.id+'" data-code="'+v.prov_code+'" value="'+v.id+'">'+v.name+'</option>');	
					}					
				});

				$(".phProvince_sel").unbind("change").change(function(e)
				{
					$(".phCity_sel option[id!='0'], .phBrgy_sel option[id!='0']").remove();
					setCity_sel($(this).children(":selected").attr("data-code"));
				});
			}
		}
		var setCity_sel= function(c)
		{
			if($(".phCity_sel").length > 0)
			{
				$(".phCity_sel option[id!='0']").remove();
				$.each(ph_city_list,function(i,v)
				{
					if(v.prov_code==c)
					{
						$(".phCity_sel").append('<option id="'+v.id+'" data-code="'+v.city_code+'" value="'+v.id+'">'+v.name+'</option>');	
					}					
				});
				$(".phCity_sel").unbind("change").change(function(e)
				{
					$(".phBrgy_sel option[id!='0']").remove();
					setBrgy_sel($(this).children(":selected").attr("data-code"));
				});
			}
		}

		var setBrgy_sel= function(c)
		{
			if($(".phBrgy_sel").length > 0)
			{	
				$(".phBrgy_sel option[id!='0']").remove();
				$.each(ph_brgy_list,function(i,v)
				{
					if(v.city_code==c)
					{
						$(".phBrgy_sel").append('<option id="'+v.id+'" value="'+v.id+'">'+v.name+'</option>');	
					}					
				});
			}
		}
	}	
});



